let fadestep = context.get("fadestep")
let level = context.get("level") || 0
let step = 1
let target = msg.payload || 0
let timing = msg.topic*1000/(Math.abs(target - level)) || 0

function fade(step,target) {
    if (level != target){
        level = level + step
        context.set("level",level)
        //node.warn("target: " + target + " level: " + level)
    }
    msg.payload = level
    node.send(msg)

    if (level === target){
        clearTimeout(fadestep);
        return;
    }
}

if (msg.hasOwnProperty("feedback")){ // if message comes from front-end
    context.set("level",msg.feedback)
    if (msg.hasOwnProperty("socketid")){ // if message is a manual input from dashboard
        clearTimeout(fadestep); //stop fading
    }
}else{
    clearTimeout(fadestep);
    target = msg.payload
    if (level < target){
        step = 1
    }else{
        step = -1
    }
    if (!msg.topic || msg.topic === "0"){
        level = msg.payload
        context.set("level",level)
        return msg;
    }else{
        fadestep = setInterval(function(){ fade(step,target)}, timing);
        context.set("fadestep",fadestep)
    }

}

